import React from 'react';

function Main(){
  return (
    <div>
      <select id = "dropdown">
        <option value="en/us">En/Us</option>
        <option value="en/ca">En/Ca</option>
        <option value="fr/ca">Fr/Ca</option>
      </select>
    </div>
  )
}

export default Main
